import React, { Component } from "react";
import { Typography } from "@material-ui/core";
import HeaderImg from "../assets/_DSC5641.jpg";
import Logo from '../assets/ll-logo.jpg'
import "./Home.css"






export default class Home extends Component {

    render() {
        return (
            <div id="content" >

                <div id="left">
                    <img src={Logo} id="Logo" />
                    <div id="headerText">
                        <Typography className="title" variant="h3" align="left">
                            A fresher way  to <br />clean your home
                        </Typography>
                        <Typography className="body" variant="title" align="left">
                            Organic and non-toxic cleaning  <br /> products for a clean and chemical free finish.
                        </Typography>

                    </div>

                </div>
                <div id="right">
                    <img id="headerImg"  src={HeaderImg} />
                </div>
            </div>

        );
    }

}
